Goście szybko podwyższyli po rzucie karnym po nieco naciąganej jednak ręce Sandera Berge. W 66min. nadzieje Norwegom dał co prawda Erling Håland, jednak to było wszystko na co było dziś stać drużynę Larsa Lagerbäcka. Był to pierwszy gol w reprezentacji (w 3 meczu) napastnika Borussii Dortmund. I to chyba jedyny pozytyw tego meczu, może jeszcze prócz gry Berge i Rune Jarsteina w bramce. Norwegowie w niczym nie przypominali poukładanego i solidnego zespołu sprzed roku.
